import React, { Component, useState, useEffect } from 'react';
import Table from 'react-bootstrap/Table';
import ServicesEleve from '../../services/ServiceFiliere';


export default function Listefraiseve() {
    const [Filiere, setFiliere] = useState([]);

    useEffect(async () => {
        ServicesEleve.getFiliere()
            .then(res => {
                const pays = res.data.Filiere;
                setFiliere({ pays });
                console.log(res.data.Filiere);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });


    }, []);
    return (
        <>
            <Table striped bordered hover variant="dark">
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Filiere</th>

                    </tr>
                </thead>
                <tbody>
                    {Filiere?.pays?.map(fil => < tr >
                        <td key={fil.id} >{fil.id}</td>
                        <td >{fil.Filiere}</td>
                    </tr>)}
                </tbody>
            </Table >
        </>

    )
}
